	add("halation", "{\"term\":\"halation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|halo|ation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of light surrounding some object as if making a halo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:William Hope William Hope Hodgson, \u0027s:The Derelict (short The Derelict\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was, as you know, to the west-ward of us, and the sunset was making a great flame of red light to the back of her, so that she showed a little blurred and indistinct by reason of the \u0027\u0027halation\u0027\u0027 of the light, which almost defeated the eye in any attempt to see her rotting spars and standing rigging, submerged, as they were, in the fiery glory of the sunset\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The blurring of light around a bright area of a photographic image, or on a television screen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, E. \u0026amp; H.T. Anthony \u0026amp; Co., \u0027Anthony\u0027s photographic bulletin for ...\u0027, Volume 32, [http://books.google.com/books?id\u003dDLZIAAAAMAAJ\u0026amp;q\u003d%22halation%22\u0026amp;dq\u003d%22halation%22\u0026amp;hl\u003den\u0026amp;ei\u003dhN0_Tt2wLMbprQea17TjDQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDQQ6AEwAw page 358\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As the result of a series of experiments on \u0027\u0027halation\u0027\u0027 carried out with backed and unbacked plates, ordinary film and stripping film, Ernest Marriage concludes that there are two varieties of \u0027\u0027halation\u0027\u0027, one due to reflection from the support and the other due to spreading of the light in the film\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, Photographers\u0027 Association of California, \u0027Camera craft\u0027, Volume 24, [http://books.google.com/books?id\u003dewzOAAAAMAAJ\u0026amp;q\u003d%22halation%22\u0026amp;dq\u003d%22halation%22\u0026amp;hl\u003den\u0026amp;ei\u003d4OA_TpCEKsbhrAfb98nBBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDMQ6AEwAzge page 81\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Halation\u0027\u0027, properly speaking, is the reflection and diffusion, within the film, from the lighter areas to the adjacent darker ones\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:Arthur Conan Arthur Conan Doyle, \u0027s:The Coming of the The Coming of the Fairies\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Among other interesting and weighty opinions, which were in general agreement with our contentions, was one by Mr. H. A. Staddon of Goodmayes, a gentleman who had made a particular hobby of fakes in photography. His report is too long and too technical for inclusion, but, under the various headings of composition, dress, development, density, lighting, poise, texture, plate, atmosphere, focus, \u0027\u0027halation\u0027\u0027, he goes very completely into the evidence, coming to the final conclusion that when tried by all these tests the chances are not less than 80 per cent. in favour of authenticity\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, \u0027Photography, Theory and Practice\u0027, Pitman, [http://books.google.com/books?id\u003d9cIyAAAAMAAJ\u0026amp;q\u003d%22halation%22\u0026amp;dq\u003d%22halation%22\u0026amp;hl\u003den\u0026amp;ei\u003dBew_Trj1D5DJrQe0xfEC\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CEMQ6AEwCDha page 173\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Halation\u0027\u0027 can be prevented or diminished by using an absorbing layer between the sensitive emulsion and the support (anti-halo undercoat) or on the back of the support (anti-halo backing\", \"priority\":12}]}, \"synonyms\":{}}");

